import React from 'react';
import './landing.css';
import logo from '.../public/blitzLogo.png';

const Landing = () => {
  const handleMyOwnClick = () => {
    // Redirect to My Own Portal
    window.location.href = 'my_own_portal';
  };

  const handleCultureClubClick = () => {
    // Redirect to The Culture Club's Portal
    window.location.href = 'culture_club_portal';
  };

  const handleCreateNewClick = () => {
    // Redirect to Create New Enterprise page
    window.location.href = 'create_new_enterprise';
  };

  return (
    <div className="container">
      <header>
        <img src="../public/logo.png" alt="Logo" />
      </header>
      <h1>Select Your Enterprise</h1>
      <div className="buttons">
        <button className="btn" id="my-own" onClick={handleMyOwnClick}>My Own Portal</button>
        <button className="btn" id="culture-club" onClick={handleCultureClubClick}>The Culture Club's Portal</button>
        <button className="btn" id="create-new" onClick={handleCreateNewClick}>Create New Enterprise <span className="plus-icon">+</span></button>
      </div>
    </div>
  );
};

export default Landing;
